parameters.functionCode:
const analysis = $json.output;
const keywords = analysis.keywords_analysis.map(k => k.keyword);

const rankingTasks = keywords.map(keyword => ({
  keyword,
  analysis: analysis.keywords_analysis.find(k => k.keyword === keyword) || {}
}));

return rankingTasks;

